  "entityModel": {
    "id": "calculateImageResolution_businessRule",
    "type": "businessRule",
    "data": {
      "attributes": {
        "name": {
          "values": [
            {
              "value": "Calculate Image Resolution"
            }
          ]
        },
        "description": {
          "values": [
            {
              "value": "based on xresolution and yresolution calculate image resolution"
            }
          ]
        },
        "ruleType": {
          "values": [
            {
              "value": "computation"
            }
          ]
        },
        "executionMode": {
          "values": [
            {
              "value": "any"
            }
          ]
        },
        "definition": {
          "values": [
            {
              "value": "varImageWidth:=GetAttributeValue[\"imagewidth\"]; varImageHeig:=GetAttributeValue[\"imageheight\"];varXResolution:=GetAttributeValue[\"xresolution\"];varYResolution:=GetAttributeValue[\"yresolution\"];varPixels:=varImageWidth*varImageHeight; varInchesResolution:=varXResolution*varYResolution;varDPIResolution:=varPixels/varInchesResolution;IIF[ValidateEmptyAttributes[\"xresolution\",\"yresolution\"],true,SetAttributeValue[\"imageresolution\",varDPIResolution]]"
            }
          ]
        },
        "enabled": {
          "values": [
